import React from "react";
import style from "./HotPlace.module.css";
import data from "./place.json"
export default class TicketTypes extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
           
        };
    }
	
	getDate=()=> {
		let table = [];
		for(let i=0;i<data.length;i++){
			table.push(
				<tr>
					<td>{data[i].rank}</td>
					<td>{data[i].place}</td>
					<td>{data[i].num}</td>
				</tr>
			);
		}
		return table;
	}
    render() {
        return (
			<table className={style.hotPlaceTable}>
				<thead>
					<tr style={{backgroundColor:'rgba(0,51,153,0.4)'}}>
						<th>排名</th>
						<th>地区</th>
						<th>数量</th>
					</tr>
				</thead>
				<tbody>
					{this.getDate()}
				</tbody>
			</table>
        )
    }
}
